export const Note = () => {
  const shareNote = async (id) => {};

  return (
    <article className="note">
      <h2>Note Title</h2>
      <p>Note Body</p>
      <section>
        <button
          onClick={() => {
            shareNote();
          }}
        >
          Share
        </button>
      </section>
    </article>
  );
};
